import React, { Component } from "react";
import { render } from "react-dom";

class Getdata extends Component {
  constructor() {
    super();

    this.state = {
      emps: []
    };
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.emps.map(function(data, key) {
            return (
              <li>
                {data.id} - {data.employee_name} - {data.employee_salary}
              </li>
            );
          })}
        </ul>
      </div>
    );
  }
}

export default Getdata;
